import React from "react";
import './index.css'

export default class Login extends React.Component{
    render() {
        return (
            <div className='login'>
                <header className='login_header'>
                    <img src="./images/timg2.png" alt="log"/>
                </header>
                <section className='login_content' ></section>
            </div>
        );
    }
}
